import * as React from "react";
import Box from "@mui/material/Box";
import { Grid, IconButton, Link, Typography, Stack, TextField, Button, InputAdornment } from "@mui/material";
import PersonIcon from "@mui/icons-material/Person";
import PhoneInTalkIcon from "@mui/icons-material/PhoneInTalk";
import EmailIcon from "@mui/icons-material/Email";
import GoogleMapReact from "google-map-react";
function Contact() {

  return (
    <>
      <Box
        component="main"
        textAlign="center"
        sx={{ p: 3, backgroundColor: "#ddd" }}
      >
        <Grid container maxWidth="lg" spacing={5}>
          <Grid item xs={12} md={8}>
            <Box style={{ height: "200", width: "100%" }}>
              <Typography variant="h4"
                
          sx={{
            "&:hover, &.Mui-focusVisible": {
              color: "#E10700",
              backgroundColor: "transparent",
            },
          }}
        >
        
            V COMPUTER CLINIC
        
              </Typography>
            </Box>
          </Grid>
          <Grid item xs={12} md={4}>
            <Box>
              <form>
                <Stack direction="column" spacing={2}>
                  <TextField
                    id="outlined-basic"
                    label="Full Name"
                    variant="outlined"
                    InputProps={{
                      startAdornment: (
                        <InputAdornment position="start">
                          <PersonIcon />
                        </InputAdornment>
                      ),
                    }}
                  />
                  <TextField
                    id="outlined-basic"
                    label="Mobile Number"
                    variant="outlined"
                    InputProps={{
                      startAdornment: (
                        <InputAdornment position="start">
                          <PhoneInTalkIcon />
                        </InputAdornment>
                      ),
                    }}
                  />
                  <TextField
                    fullWidth
                    id="outlined-basic"
                    label="Email Id"
                    variant="outlined"
                    InputProps={{
                      startAdornment: (
                        <InputAdornment position="start">
                          <EmailIcon />
                        </InputAdornment>
                      ),
                    }}
                  />
                  <Button variant="outlined">Submit</Button>
                </Stack>
              </form>
            </Box>
          </Grid>
        </Grid>
      </Box>
    </>
  );
}
export default Contact;
